import React from "react";
import './Contact.css'
function Contact() {
  return (
    <>
    <div className="container con text-center my-5 ">
        <h1 style={{ color: "#e8762b" }}>CONTACT US</h1>
        <p>Book your villa now</p>

        <hr />
      </div>

      <div className="container">
        <div className="row">
          <div className="box1 col-4 m-3">


              <img className="contactImg" src="https://alpineriverhill.com/assets/img/5.jpg" alt="" />
            </div>
          </div>
          <div className="box2 col-4"></div>

      </div>
    </>
  );
}

export default Contact;
